import React from 'react';
import { Marks } from './Marks';
import { Markscity } from './Markscity';
import { hexbin } from 'd3-hexbin';
import { geoNaturalEarth1 } from 'd3';

export const BubbleMap = ({ data, worldAtlas }) => {
    // Adjusted projection parameters
    const projection = geoNaturalEarth1()
        .center([10.537004, 52.210297]) // Center over Braunschweig
        .scale(200000) // Higher value to ensure better positioning
        .translate([450, 375]); // Center your SVG

    const hexbinGenerator = hexbin()
        .size([900, 750]) // Match your SVG size
        .radius(30); // Set radius for visibility

    // Hardcoded test data
    const testPoints = [
        { coords: [10.537004, 52.210297], HRV: 50 }, // Center test point
        { coords: [10.54, 52.21], HRV: 80 },
        { coords: [10.53, 52.20], HRV: 100 },
    ];

    // Project the test coordinates
    const projectedTestData = testPoints.map(d => {
        const coords = projection(d.coords);
        console.log("Projected Coords (Test):", coords, "HRV:", d.HRV); // Log projected coords
        return { ...d, coords };
    });

    // Log ranges of projected coordinates
    const xValues = projectedTestData.map(d => d.coords[0]);
    const yValues = projectedTestData.map(d => d.coords[1]);
    console.log("X range:", Math.min(...xValues), Math.max(...xValues));
    console.log("Y range:", Math.min(...yValues), Math.max(...yValues));

    // Generate hex bin data
    const testBins = hexbinGenerator(projectedTestData);
    console.log("Test Hex Bin Data:", testBins); // Log hex bins

    return (
        <>
            <Marks bins={testBins} />
            <Markscity worldAtlas={worldAtlas} />
        </>
    );
};
